import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from "./HomePage";
import HeaderNav from "./HeaderNav";
import DropdownMenu from './DropdownMenu';
import MyBets from "./MyBets";
import ActiveBets from "./ActiveBets";
import PageLayout from "./PageLayout";
import Shortlists from "./Shortlists";
import ExpiredBets from "./ExpiredBets";
import Leaderboard from "./Leaderboard";
import AdminPanel from "./AdminPanel";
import PlacementData from "./PlacementData";
import Login from "./Login";
import Profile from "./Profile";

export default function App() {
  const [showUserGuideModal, setShowUserGuideModal] = React.useState(false);
  return (
    <BrowserRouter>
      <HeaderNav showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />
      <Routes>
        <Route path="/" element={<HomePage showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/home" element={<HomePage showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/my-bets" element={<MyBets showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/active-bets" element={<ActiveBets showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/shortlists" element={<Shortlists showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/expired-bets" element={<ExpiredBets showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/leaderboard" element={<Leaderboard showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/admin-panel" element={<AdminPanel showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/placement-data" element={<PlacementData showUserGuideModal={showUserGuideModal} setShowUserGuideModal={setShowUserGuideModal} />} />
        <Route path="/login" element={<Login />} />
        <Route path="/profile" element={<Profile />} />
      </Routes>
    </BrowserRouter>
  );
}
